import './contact.css';

const ContactSectionStyle = styled.div`
padding: 10rem 0;
`

export default function Contact() {
  return (
    <div>

    <div className="container">
    <ContactSectionStyle>

      <heading Contact>
        <subheading>
          Get In Touch
        </subheading>
      </heading>

    </ContactSectionStyle>
    </div>
    </div>
  )
}
